    [UIEnums.MpScoreboard.Legends] = {icon_sheet = "fe_icons", icon_name = "Legend"},
    [UIEnums.MpScoreboard.Lobby] = {
      icon_sheet = "fe_icons",
      icon_name = "leaderboards"
    }
